/**
 * Gather all ForeignKey instances from the selection list of objects that are contained by the
 * specified Table
 *
 * @return
 */
static List getForeignKeys(final List eObjects, final Table container) {
  CoreArgCheck.isNotNull(eObjects);
  CoreArgCheck.isNotNull(container);
  final List result = new ArrayList(eObjects.size());
  for (Iterator iter = eObjects.iterator(); iter.hasNext(); ) {
    final Object obj = iter.next();
    if (obj instanceof ForeignKey && ((ForeignKey) obj).eContainer() == container) {
      result.add(obj);
    }
  }
  return result;
}

/**
 * Process a query, filling in with fields, and return the results as a List, one per record read.
 * If a reader is provided, it will be called for each record to prepare the Object placed into
 * the List. Otherwise, the first field of each record, as a String, will be placed in the list.
 *
 * @param callerConn The db connection object to use (if not null).
 * @param sql The sql statement.
 * @param fields The array of fields for parameters.
 * @param reader The reader object to read each record.
 * @return The List of things read, one per record.
 */
public List dbRead(Connection callerConn, String sql, Object[] fields, SqlReader reader) {
  // check for a transaction conncetion
  if (callerConn == null) {
    callerConn = (Connection) threadLocalManager().get(TRANSACTION_CONNECTION);
  }

  if (LOG.isDebugEnabled()) {
    LOG.debug(
        "dbRead(Connection "
            + callerConn
            + ", String "
            + sql
            + ", Object[] "
            + Arrays.toString(fields)
            + ", SqlReader "
            + reader
            + ")");
  }

  // for DEBUG
  long start = 0;
  long connectionTime = 0;
  int lenRead = 0;
  long stmtTime = 0;
  long resultsTime = 0;
  int count = 0;

  if (LOG.isDebugEnabled()) {
    String userId = usageSessionService().getSessionId();
    StringBuilder buf = new StringBuilder();
    if (fields != null) {
      buf.append(fields[0]);
      for (int i = 1; i < fields.length; i++) {
        buf.append(", ");
        buf.append(fields[i]);
      }
    }
    LOG.debug("Sql.dbRead: " + userId + "\n" + sql + "\n" + buf);
  }

  Connection conn = null;
  PreparedStatement pstmt = null;
  ResultSet result = null;
  ResultSetMetaData meta = null;
  List rv = new Vector();

  try {
    if (m_showSql) {
      start = System.currentTimeMillis();
    }

    // borrow a new connection if we are not provided with one to use
    if (callerConn != null) {
      conn = callerConn;
    } else {
      conn = borrowConnection();
    }
    if (m_showSql) {
      connectionTime = System.currentTimeMillis() - start;
    }
    if (m_showSql) {
      start = System.currentTimeMillis();
    }
    pstmt = conn.prepareStatement(sql);

    // put in all the fields
    prepareStatement(pstmt, fields);

    result = pstmt.executeQuery();

    if (m_showSql) {
      stmtTime = System.currentTimeMillis() - start;
    }
    if (m_showSql) {
      start = System.currentTimeMillis();
    }

    while (result.next()) {
      if (m_showSql) {
        count++;
      }

      // without a reader, we read the first String from each record
      if (reader == null) {
        String s = result.getString(1);
        if (s != null) {
          rv.add(s);
        }
      } else {
        try {
          Object obj = reader.readSqlResultRecord(result);
          if (obj != null) {
            rv.add(obj);
          }
        } catch (SqlReaderFinishedException e) {
          break;
        }
      }
    }
  } catch (SQLException e) {
    LOG.warn("Sql.dbRead: sql: " + sql + debugFields(fields), e);
  } catch (UnsupportedEncodingException e) {
    LOG.warn("Sql.dbRead: sql: " + sql + debugFields(fields), e);
  } finally {
    if (m_showSql) {
      resultsTime = System.currentTimeMillis() - start;
    }
    if (null != result) {
      try {
        result.close();
      } catch (SQLException e) {
        LOG.warn("Sql.dbRead: sql: " + sql + debugFields(fields), e);
      }
    }
    if (null != pstmt) {
      try {
        pstmt.close();
      } catch (SQLException e) {
        LOG.warn("Sql.dbRead: sql: " + sql + debugFields(fields), e);
      }
    }

    // return the connection only if we have borrowed a new one for this call
    if (callerConn == null) {
      if (null != conn) {
        // if we commit on read
        if (m_commitAfterRead) {
          try {
            conn.commit();
          } catch (SQLException e) {
            LOG.warn("Sql.dbRead: sql: " + sql + debugFields(fields), e);
          }
        }
        returnConnection(conn);
      }
    }
  }

  if (m_showSql)
    debug(
        "Sql.dbRead: time: "
            + connectionTime
            + " / "
            + stmtTime
            + " / "
            + resultsTime
            + " #: "
            + count,
        sql,
        fields);

  return rv;
}

