public Object set(PageContext pc, Object coll, Collection.Key key, Object value)
    throws PageException {
  // Objects
  if (coll instanceof Objects) {
    ((Objects) coll).set(pc, key, value);
    return value;
  }
  // Collection
  else if (coll instanceof Collection) {
    ((Collection) coll).set(key, value);
    return value;
  }
  // Map
  else if (coll instanceof Map) {
    /* no idea why this is here
    try {
    Reflector.setProperty(coll,key.getString(),value);
    return value;
    }
    catch(Throwable t) {t.printStackTrace();}*/
    ((Map) coll).put(key.getString(), value);
    return value;
  }
  // List
  else if (coll instanceof List) {
    List list = ((List) coll);
    int index = Caster.toIntValue(key.getString());
    if (list.size() >= index) list.set(index - 1, value);
    else {
      while (list.size() < index - 1) list.add(null);
      list.add(value);
    }
    return value;
  }
  // Native Array
  else if (Decision.isNativeArray(coll)) {
    try {
      return ArrayUtil.set(coll, Caster.toIntValue(key.getString()) - 1, value);
    } catch (Exception e) {
      throw new ExpressionException(
          "invalid index [" + key.getString() + "] for Native Array, can't expand Native Arrays");
    }
  }
  // Node
  else if (coll instanceof Node) {
    return XMLUtil.setProperty((Node) coll, key, value);
  }
  // Direct Object Access
  if (pc.getConfig().getSecurityManager().getAccess(SecurityManager.TYPE_DIRECT_JAVA_ACCESS)
      == SecurityManager.VALUE_YES) {
    try {
      Reflector.setProperty(coll, key.getString(), value);
      return value;
    } catch (PageException pe) {
    }
  }
  throw new ExpressionException(
      "can't assign value to a Object of this type ["
          + Type.getName(coll)
          + "] with key "
          + key.getString());
}

