/**
 * Create a LOB instance for the given PreparedStatement, populating it via the given callback.
 */
protected Object createLob(PreparedStatement ps, boolean clob, LobCallback callback)
    throws SQLException {

  Connection con = null;
  try {
    con = getOracleConnection(ps);
    initOracleDriverClasses(con);
    Object lob = prepareLob(con, clob ? clobClass : blobClass);
    callback.populateLob(lob);
    lob.getClass().getMethod("close", (Class[]) null).invoke(lob, (Object[]) null);
    this.createdLobs.add(lob);
    if (logger.isDebugEnabled()) {
      logger.debug("Created new Oracle " + (clob ? "CLOB" : "BLOB"));
    }
    return lob;
  } catch (SQLException ex) {
    throw ex;
  } catch (InvocationTargetException ex) {
    if (ex.getTargetException() instanceof SQLException) {
      throw (SQLException) ex.getTargetException();
    } else if (con != null && ex.getTargetException() instanceof ClassCastException) {
      throw new InvalidDataAccessApiUsageException(
          "OracleLobCreator needs to work on [oracle.jdbc.OracleConnection], not on ["
              + con.getClass().getName()
              + "]: specify a corresponding NativeJdbcExtractor",
          ex.getTargetException());
    } else {
      throw new DataAccessResourceFailureException(
          "Could not create Oracle LOB", ex.getTargetException());
    }
  } catch (Exception ex) {
    throw new DataAccessResourceFailureException("Could not create Oracle LOB", ex);
  }
}

/**
 * inserts value into the map for key as a single element or, if values already exist, as an entry
 * in key's list.
 *
 * @param key an <code>Object</code> value
 * @param value an <code>Object</code> value
 * @return null
 */
public Object put(Object key, Object value) {
  if (containsKey(key)) {
    Object other = get(key);
    if (other instanceof List) {
      ((List) other).add(value);
    } else {
      List l = new ArrayList();
      l.add(other);
      l.add(value);
      super.put(key, l);
    }
  } else {
    super.put(key, value);
  }
  return null;
}

private void mapBinding(Map map, List attributes) {
  for (Iterator i = attributes.iterator(); i.hasNext(); ) {
    Node attribute = (Node) i.next();
    String name = attribute.getComponent().getName();
    Object value = attribute.getValue();

    if (map.containsKey(name)) {
      List values;
      Object obj = map.get(name);

      if (obj instanceof List) {
        values = (List) obj;
      } else {
        values = new ArrayList();
        values.add(obj);
        map.put(name, values);
      }

      values.add(value);
    } else {
      map.put(name, value);
    }
  }
}

public Map process(UIBlockContext parser) {
  Map ctx = new HashMap();
  this.init(parser, ctx);

  List result = new ArrayList();
  if (parser.getPageSize() == 1) {
    Object record = parser.getItemObj();
    if (record != null) {
      result.add(record);
    }
  }
  if (result.size() == 0) {
    result = parser.query(getExpr(parser));
    if (parser.getBlock().isFillBlank())
      for (int i = result.size(); i < parser.getPageSize(); i++) {
        result.add(null);
      }
  }

  UIBlockDataModel data = parser.getCatalog();
  if (parser.getCellCount() == 1) {
    for (Object obj : result) {
      if (obj == null) data.addItem(new UIBlockDataModel());
      else data.addItem(parser.makeDataModel(obj));
    }
  } else {
    List<List> listlist = parser.querySplit(result);
    for (List list : listlist) {
      UIBlockDataModel row = new UIBlockDataModel();
      data.addItem(row);
      for (Object obj : list) {
        if (obj == null) row.addItem(parser.makeDataModel(null));
        else row.addItem(parser.makeDataModel(obj));
      }
    }
  }

  ctx.put("data", data);
  ctx.put("pager", parser.getPager());

  return ctx;
}

