/**
 * Sets the given collection to the current targets. If the collection equals the current targets,
 * then does nothing. When setting the targets, a TargetEvent will be fired to each interested
 * listener. Note that the first element returned by an Iterator on targetList will be taken to be
 * the primary target (see getTarget()), and that an event will be fired also in case that that
 * element would not equal the element returned by getTarget(). Note also that any nulls within
 * the Collection will be ignored.
 *
 * @param targetsCollection The new targets list.
 */
public synchronized void setTargets(Collection targetsCollection) {
  Iterator ntarg;

  if (isInTargetTransaction()) {
    return;
  }

  Collection targetsList = new ArrayList();
  if (targetsCollection != null) {
    targetsList.addAll(targetsCollection);
  }

  /* Remove duplicates and take care of getOwner()
   * and remove nulls: */
  List modifiedList = new ArrayList();
  Iterator it = targetsList.iterator();
  while (it.hasNext()) {
    Object o = it.next();
    o = getOwner(o);
    if ((o != null) && !modifiedList.contains(o)) {
      modifiedList.add(o);
    }
  }
  targetsList = modifiedList;

  Object[] oldTargets = null;

  // check if there are new elements in the list
  // if the old and new list are of the same size
  // set the oldTargets to the correct selection
  if (targetsList.size() == targets.size()) {
    boolean first = true;
    ntarg = targetsList.iterator();

    while (ntarg.hasNext()) {
      Object targ = ntarg.next();
      if (targ == null) {
        continue;
      }
      if (!targets.contains(targ) || (first && targ != getTarget())) {
        oldTargets = targets.toArray();
        break;
      }
      first = false;
    }
  } else {
    oldTargets = targets.toArray();
  }

  if (oldTargets == null) {
    return;
  }

  startTargetTransaction();

  umlListener.removeAllListeners(targets);
  targets.clear();

  // implement set-like behaviour. The same element
  // may not be added more then once.
  ntarg = targetsList.iterator();
  while (ntarg.hasNext()) {
    Object targ = ntarg.next();
    if (targets.contains(targ)) {
      continue;
    }
    targets.add(targ);
    umlListener.addListener(targ);
  }

  internalOnSetTarget(TargetEvent.TARGET_SET, oldTargets);

  endTargetTransaction();
}

/**
 * Helper method for subclasses to set values of indexed properties, like map-values,
 * collection-values or array-values.
 *
 * @param assemblageType either map or collection or array
 * @param assemblage the assemblage to set the value on
 * @param index the index to set the value at
 * @param value the value to set
 * @return the assemblage
 */
protected Object setAssemblageValue(
    Class assemblageType, Object assemblage, Object index, Object value) {
  if (assemblageType.isArray()) {
    int i = ((Integer) index).intValue();
    if (Array.getLength(assemblage) <= i) {
      Object newAssemblage = Array.newInstance(assemblageType.getComponentType(), i + 1);
      System.arraycopy(assemblage, 0, newAssemblage, 0, Array.getLength(assemblage));
      assemblage = newAssemblage;
    }
    Array.set(assemblage, i, value);
  } else if (List.class.isAssignableFrom(assemblageType)) {
    int i = ((Integer) index).intValue();
    List list = (List) assemblage;
    if (list.size() > i) {
      list.set(i, value);
    } else {
      while (list.size() < i) {
        list.add(null);
      }
      list.add(value);
    }
  } else if (Map.class.isAssignableFrom(assemblageType)) {
    ((Map) assemblage).put(index, value);
  } else if (assemblage instanceof Collection) {
    ((Collection) assemblage).add(value);
  } else {
    throw new IllegalArgumentException("assemblage must be of type array, collection or map.");
  }
  return assemblage;
}

