private static List parseArray(CharacterIterator it) {
  it.next();
  JSONReader.parseWhitespace(it);
  if (it.current() == ']') {
    it.next();
    return Collections.EMPTY_LIST;
  }

  List list = new ArrayList();
  while (true) {
    Object value = JSONReader.parseValue(it);
    list.add(value);
    JSONReader.parseWhitespace(it);
    if (it.current() == ',') {
      it.next();
      JSONReader.parseWhitespace(it);
      continue;
    }

    if (it.current() != ']') {
      throw JSONReader.error(
          "expected an array close ']' but was '" + it.current() + "'",
          it); // $NON-NLS-1$ //$NON-NLS-2$
    }
    break;
  }
  it.next();
  return list;
}

