private void writeCollection(
    final MappedField mf,
    final DBObject dbObject,
    Map<Object, DBObject> involvedObjects,
    String name,
    Object fieldValue,
    Mapper mapr) {
  Iterable coll = null;

  if (fieldValue != null)
    if (mf.isArray) coll = Arrays.asList((Object[]) fieldValue);
    else coll = (Iterable) fieldValue;

  if (coll != null) {
    List values = new ArrayList();
    for (Object o : coll) {
      if (null == o) values.add(null);
      else if (mapr.converters.hasSimpleValueConverter(mf)
          || mapr.converters.hasSimpleValueConverter(o.getClass()))
        values.add(mapr.converters.encode(o));
      else {
        Object val;
        if (Collection.class.isAssignableFrom(o.getClass())
            || Map.class.isAssignableFrom(o.getClass())) val = mapr.toMongoObject(o, true);
        else val = mapr.toDBObject(o, involvedObjects);

        if (!shouldSaveClassName(o, val, mf))
          ((DBObject) val).removeField(Mapper.CLASS_NAME_FIELDNAME);

        values.add(val);
      }
    }
    if (values.size() > 0 || mapr.getOptions().storeEmpties) {
      dbObject.put(name, values);
    }
  }
}

@Override
public synchronized boolean add(Object object) {
  Object param = object;
  Object handler = null;
  try {
    handler = Proxy.getInvocationHandler(object);
  } catch (IllegalArgumentException e) {
    // ignore, this is a leaf
  }
  if (handler != null && handler instanceof WriteableView) {
    ConfigBean master = ((WriteableView) handler).getMasterView();
    String key = master.model.key;
    if (key != null) {
      // remove leading @
      key = key.substring(1);
      // check that we are not adding a duplicate key element
      String keyValue = ((WriteableView) handler).getPropertyValue(key);
      for (Object o : proxied) {
        // the proxied object can be a read-only or a writeable view, we need
        // to be careful
        // ToDo : we need to encasulate this test.
        String value = null;
        if (Proxy.getInvocationHandler(o) instanceof WriteableView) {
          ConfigBean masterView = ((WriteableView) handler).getMasterView();
          String masterViewKey = masterView.model.key;
          if (masterViewKey != null && key.equals(masterViewKey.substring(1))) {
            value = ((WriteableView) Proxy.getInvocationHandler(o)).getPropertyValue(key);
          }
        } else {
          Dom cbo = Dom.unwrap((ConfigBeanProxy) o);
          String cboKey = cbo.model.key;
          if (cboKey != null && key.equals(cboKey.substring(1))) {
            value = cbo.attribute(key);
          }
        }
        if (keyValue != null && value != null && keyValue.equals(value)) {
          Dom parent = Dom.unwrap(readView);
          throw new IllegalArgumentException(
              "A "
                  + master.getProxyType().getSimpleName()
                  + " with the same key \""
                  + keyValue
                  + "\" already exists in "
                  + parent.getProxyType().getSimpleName()
                  + " "
                  + parent.getKey());
        }
      }
    }
    param =
        ((WriteableView) handler)
            .getMasterView()
            .createProxy((Class<ConfigBeanProxy>) master.getImplementationClass());
  }
  changeEvents.add(new PropertyChangeEvent(defaultView, id, null, param));
  return proxied.add(object);
}

void order(Object node, List list, Set nodes, boolean preOrder) {
  if (preOrder && nodes.contains(node)) list.add(node);
  if (expanded.contains(node)) {
    Object[] children = model.getChildren(node);
    for (int i = 0; i < children.length; i++) order(children[i], list, nodes, preOrder);
  }
  if (!preOrder && nodes.contains(node)) list.add(node);
}

