/**
 * Fill in the launch info config info and contribs. The contribs sent in may be expanded due to
 * extension points and a new one created. Either the expanded copy or the original (if no change)
 * will be stored in the launchinfo and returned from this call.
 *
 * @param aContribs this should never be <code>null</code>. Pass in {@link
 *     ProxyLaunchSupport#EMPTY_CONFIG_CONTRIBUTORS} in that case.
 * @param launchInfo
 * @param projectName
 * @return a modified aContribs if any change was made to it. This will never be <code>null</code>
 *     . It will return an empty list if aContribs was null and no changes were made.
 * @throws JavaModelException
 * @throws CoreException
 * @since 1.0.0
 */
public static IConfigurationContributor[] fillInLaunchInfo(
    IConfigurationContributor[] aContribs, LaunchInfo launchInfo, String projectName)
    throws JavaModelException, CoreException {
  if (projectName != null) {
    projectName = projectName.trim();
    if (projectName.length() > 0) {
      IProject project = ResourcesPlugin.getWorkspace().getRoot().getProject(projectName);
      IJavaProject javaProject = JavaCore.create(project);
      if (javaProject != null && javaProject.exists()) {
        launchInfo.configInfo = createDefaultConfigurationContributionInfo(javaProject);
        if (!launchInfo.configInfo.getContainerIds().isEmpty()
            || !launchInfo.configInfo.getContainers().isEmpty()
            || !launchInfo.configInfo.getPluginIds().isEmpty()) {
          List computedContributors =
              new ArrayList(
                  launchInfo.configInfo.getContainerIds().size()
                      + launchInfo.configInfo.getContainers().size()
                      + launchInfo.configInfo.getPluginIds().size());
          // Note: We don't care about the visibility business here. For contributors to proxy it
          // means
          // some classes in the projects/plugins/etc. need configuration whether they are visible
          // or not.
          // This is because even though not visible, some other visible class may instantiate it.
          // So it
          // needs the configuration.
          // First handle explicit classpath containers that implement IConfigurationContributor
          for (Iterator iter = launchInfo.configInfo.getContainers().keySet().iterator();
              iter.hasNext(); ) {
            IClasspathContainer container = (IClasspathContainer) iter.next();
            if (container instanceof IConfigurationContributor)
              computedContributors.add(container);
          }

          // Second add in contributors that exist for a container id.
          for (Iterator iter = launchInfo.configInfo.getContainerIds().values().iterator();
              iter.hasNext(); ) {
            ContainerPaths paths = (ContainerPaths) iter.next();
            IConfigurationElement[] contributors =
                ProxyPlugin.getPlugin()
                    .getContainerConfigurations(paths.getContainerId(), paths.getAllPaths());
            if (contributors != null)
              for (int i = 0; i < contributors.length; i++) {
                Object contributor =
                    contributors[i].createExecutableExtension(ProxyPlugin.PI_CLASS);
                if (contributor instanceof IConfigurationContributor)
                  computedContributors.add(contributor);
              }
          }

          // Finally add in contributors that exist for a plugin id.
          for (Iterator iter = launchInfo.configInfo.getPluginIds().keySet().iterator();
              iter.hasNext(); ) {
            String pluginId = (String) iter.next();
            IConfigurationElement[] contributors =
                ProxyPlugin.getPlugin().getPluginConfigurations(pluginId);
            if (contributors != null)
              for (int i = 0; i < contributors.length; i++) {
                Object contributor =
                    contributors[i].createExecutableExtension(ProxyPlugin.PI_CLASS);
                if (contributor instanceof IConfigurationContributor)
                  computedContributors.add(contributor);
              }
          }

          // Now turn into array
          if (!computedContributors.isEmpty()) {
            IConfigurationContributor[] newContribs =
                new IConfigurationContributor[aContribs.length + computedContributors.size()];
            System.arraycopy(aContribs, 0, newContribs, 0, aContribs.length);
            IConfigurationContributor[] cContribs =
                (IConfigurationContributor[])
                    computedContributors.toArray(
                        new IConfigurationContributor[computedContributors.size()]);
            System.arraycopy(cContribs, 0, newContribs, aContribs.length, cContribs.length);
            aContribs = newContribs;
          }
        }
      }
    }
  }

  launchInfo.contributors = aContribs;
  return aContribs;
}

