}

/**
 * Sets the issuer names criterion. Pass <code>null</code> to clear this value. CRLs matched by
 * this selector must have an issuer name in this set.
 *
 * @param names The issuer names.
 * @throws IOException If any of the elements in the collection is not a valid name.
 */
public void setIssuerNames(Collection<?> names) throws IOException {
  if (names == null) {
    issuerNames = null;
    return;
  }
  List l = new ArrayList(names.size());
  for (Iterator it = names.iterator(); it.hasNext(); ) {
    Object o = it.next();
    if (o instanceof X500Principal) l.add(o);
    else if (o instanceof String) {
      try {
        l.add(new X500Principal((String) o));
      } catch (IllegalArgumentException iae) {
        IOException ioe = new IOException("malformed name: " + o);
        ioe.initCause(iae);
        throw ioe;
      }
    } else if (o instanceof byte[]) {
      try {
        l.add(new X500Principal((byte[]) o));
      } catch (IllegalArgumentException iae) {
        IOException ioe = new IOException("malformed name");
        ioe.initCause(iae);
        throw ioe;
      }
    } else if (o instanceof InputStream) {
      try {
        l.add(new X500Principal((InputStream) o));
      } catch (IllegalArgumentException iae) {
        IOException ioe = new IOException("malformed name");
        ioe.initCause(iae);
        throw ioe;
      }
    } else
      throw new IOException("not a valid name: " + (o != null ? o.getClass().getName() : "null"));
  }
  issuerNames = l;
}

