protected List initChildren(Object object) {
  localChildren = new ArrayList();
  Application app = (Application) getParent();
  IVirtualComponent ear = ComponentUtilities.findComponent(app);
  List modules = app.getModules();
  List binaryModules = new ArrayList();
  IVirtualReference[] refs = ear.getReferences();
  for (int i = 0; i < modules.size(); i++) {
    Module module = (Module) modules.get(i);
    String moduleURI = module.getUri();
    boolean foundBinary = false;
    if (moduleURI != null) {
      String moduleName = new Path(moduleURI).lastSegment();
      for (int j = 0; j < refs.length && !foundBinary; j++) {
        IVirtualComponent component = refs[j].getReferencedComponent();
        if (component.isBinary()) {
          if (refs[j].getArchiveName().equals(moduleName)) {
            foundBinary = true;
            JavaEEBinaryComponentHelper helper = null;
            try {
              helper = new JavaEEBinaryComponentHelper(component);
              Object binaryModule = helper.getPrimaryRootObject();
              if (binaryModule != null) {
                binaryModules.add(binaryModule);
              }
            } finally {
              if (helper != null) {
                helper.dispose();
              }
            }
          }
        }
      }
    }
    if (!foundBinary) {
      localChildren.add(module);
    }
  }

  if (!binaryModules.isEmpty()) {
    localChildren.add(new J2EEBinaryModulesItemProvider(app, getAdapterFactory(), binaryModules));
  }

  return localChildren;
}

/**
 * Append a user parameter value for a specific column. User parameters are marked as opposed to
 * the parameters inserted by the internal runtime system. This helps to reuse the buffer by
 * reparmeterizing it with new set of user parameters while the 'internal' parameters remain
 * unchanged.
 *
 * @param userParam if non-null, designates a 'user' parameter.
 */
public SQLBuffer appendValue(Object o, Column col, Parameter userParam) {
  if (o == null) _sql.append("NULL");
  else if (o instanceof Raw) _sql.append(o.toString());
  else {
    _sql.append(PARAMETER_TOKEN);

    // initialize param and col lists; we hold off on col list until
    // we get the first non-null col
    if (_params == null) _params = new ArrayList();
    if (_userParams == null) _userParams = new ArrayList();
    if (col != null && _cols == null) {
      _cols = new ArrayList();
      while (_cols.size() < _params.size()) _cols.add(null);
    }

    _params.add(o);
    if (userParam != null) {
      Object param = userParam;
      if (userParam instanceof CollectionParam) param = ((CollectionParam) userParam).clone();
      _userParams.add(param);
      if (_userIndex == null) _userIndex = new ArrayList();
      int index = _params.size() - 1;
      _userIndex.add(index);
      _userIndex.add(param);
    } else _userParams.add(o);
    if (_cols != null) _cols.add(col);
  }
  return this;
}

private void readCollection(
    final DBObject dbObject,
    final MappedField mf,
    final Object entity,
    EntityCache cache,
    Mapper mapr) {
  // multiple documents in a List
  Collection values =
      mf.isSet()
          ? mapr.getOptions().objectFactory.createSet(mf)
          : mapr.getOptions().objectFactory.createList(mf);

  Object dbVal = mf.getDbObjectValue(dbObject);
  if (dbVal != null) {

    List dbVals = null;
    if (dbVal instanceof List) dbVals = (List) dbVal;
    else {
      dbVals = new BasicDBList();
      dbVals.add(dbVal);
    }

    for (Object o : dbVals) {

      DBObject dbObj = (DBObject) o;
      Object newEntity = null;

      if (dbObj != null) {
        // run converters
        if (mapr.converters.hasSimpleValueConverter(mf)
            || mapr.converters.hasSimpleValueConverter(mf.getSubClass()))
          newEntity = mapr.converters.decode(mf.getSubClass(), dbObj, mf);
        else {
          newEntity = readMapOrCollectionOrEntity(dbObj, mf, cache, mapr);
        }
      }

      values.add(newEntity);
    }
  }
  if (values.size() > 0) {
    if (mf.getType().isArray()) {
      mf.setFieldValue(
          entity,
          ReflectionUtils.convertToArray(mf.getSubClass(), ReflectionUtils.iterToList(values)));
    } else {
      mf.setFieldValue(entity, values);
    }
  }
}

