/**
 * Returns the criterion for subject alternative names.
 *
 * <p>the certificate must contain all or at least one of the specified subject alternative names.
 * The behavior is specified by {@link #getMatchAllSubjectAltNames}.
 *
 * <p>The subject alternative names is a collection with an entry for each name included in the
 * criterion. The name is specified as a {@code List}, the first entry is an {@code Integer}
 * specifying the name type (0-8), the second entry is byte array specifying the name in ASN.1 DER
 * encoded form)
 *
 * @return the names collection or {@code null} if none specified.
 * @since Android 1.0
 */
public Collection<List<?>> getSubjectAlternativeNames() {
  if (subjectAltNames == null) {
    return null;
  }
  ArrayList result = new ArrayList();
  for (int tag = 0; tag < 9; tag++) {
    if (subjectAltNames[tag] != null) {
      Integer teg = new Integer(tag);
      for (int name = 0; name < subjectAltNames[tag].size(); name++) {
        Object neim = subjectAltNames[tag].get(name);
        if (neim instanceof byte[]) {
          byte[] arr_neim = (byte[]) neim;
          neim = new byte[arr_neim.length];
          System.arraycopy(arr_neim, 0, neim, 0, arr_neim.length);
        }
        List list = new ArrayList(2);
        list.add(teg);
        list.add(neim);
        result.add(list);
      }
    }
  }
  return result;
}

