public boolean containsAll(Collection coll) {
  List searchColl = new ArrayList();
  Iterator it = coll.iterator();
  while (it.hasNext()) {
    Object feature = it.next();
    if (feature instanceof PreGeneralizedSimpleFeature)
      searchColl.add(((PreGeneralizedSimpleFeature) feature).feature);
    else searchColl.add(feature);
  }
  return backendCollection.containsAll(searchColl);
}

public Collection engineGetCertificates(CertSelector selector) throws CertStoreException {
  List col = new ArrayList();
  Iterator iter = params.getCollection().iterator();

  if (selector == null) {
    while (iter.hasNext()) {
      Object obj = iter.next();

      if (obj instanceof Certificate) {
        col.add(obj);
      }
    }
  } else {
    while (iter.hasNext()) {
      Object obj = iter.next();

      if ((obj instanceof Certificate) && selector.match((Certificate) obj)) {
        col.add(obj);
      }
    }
  }

  return col;
}

public List evaluateParams(Context context) throws JaxenException {
  List paramExprs = getParameters();
  int paramSize = paramExprs.size();

  List paramValues = new ArrayList(paramSize);

  for (int i = 0; i < paramSize; ++i) {
    Expr eachParam = (Expr) paramExprs.get(i);

    Object eachValue = eachParam.evaluate(context);

    paramValues.add(eachValue);
  }
  return paramValues;
}

/**
 * Returns the common denominator resource class for the given collection of objects. Do not
 * return a resource class if the objects are resources themselves so as to prevent double
 * registration of actions.
 */
private Class getCommonResourceClass(List objects) {
  if (objects == null || objects.size() == 0) {
    return null;
  }
  Class resourceClass = LegacyResourceSupport.getResourceClass();
  if (resourceClass == null) {
    // resources plug-in not loaded - no resources. period.
    return null;
  }

  List testList = new ArrayList(objects.size());

  for (int i = 0; i < objects.size(); i++) {
    Object object = objects.get(i);

    if (object instanceof IAdaptable) {
      if (resourceClass.isInstance(object)) {
        continue;
      }

      Object resource = LegacyResourceSupport.getAdaptedContributorResource(object);

      if (resource == null) {
        // Not a resource and does not adapt. No common resource class
        return null;
      }
      testList.add(resource);
    } else {
      return null;
    }
  }

  return getCommonClass(testList);
}

